import React from 'react'
import { Link } from 'react-router-dom';  

function DataInput({memos,title,handlesubmit}) {
    const memo = memos.find(memo => memo.title === title);
    if (!memo) {
        return <div>Memo not found</div>; // 해당 메모가 없을 때 처리
    }
  return (
    <>
    <div className='bar'>
        <Link to='/memo'>
            <button className="w-btn w-btn-indigo" type="button">back</button>
        </Link>
        <button  className="w-btn w-btn-pink" onClick={handlesubmit} type="button">Corret</button>
    </div>
    <div className='title'>
                <div className='text_title'>{memo.title}</div>
                <div className='content'>{memo.content}</div>
            </div>
</>
  )
}

export default DataInput
